import Link from 'next/link'

import styled from "styled-components";
import Post from "./posts/post";

function App() {
  return (
    <div>
      Learn <a href="https://nextjs.org">Next.js!</a>
      Read <Link href="/posts/post"><a>this page!</a></Link>
    </div>
  );
}

const Title = styled.h1`
  color: #333;
`;

export default App;
